import React from "react";
import Data from "../../Data";
import Slider from "react-slick";
import "./slide.css"; // Import CSS file for styling

const Slide = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 3
  };

  return (
    <div className="slider-container w-3/4 m-auto">
      <Slider {...settings}>
        {Data.map((item, index) => (
          <>
          <div key={index} className=" border-2 row flex bg-red-900">
            <h1>{item.name}</h1>
          </div>
          <div>

            <h1>{item.class}</h1>
            <h1>{item.sdfd}</h1>
          </div>
          </>
        ))}
      </Slider>
    </div>
  );
};

export default Slide;
